import axios from 'axios';

const API_URL = 'http://localhost:8080/authenticate'

class AuthenticationService{
    authenticationToken = '';

    login(){
        authenticationToken = axios.post(API_URL);
    }

    logout(){

    }
}

export default new AuthenticationService();
